import { Link } from "react-router-dom";

function Nav() {
  return (
    <ul>
      <li>
        <Link to={`/`}>HOME</Link>
      </li>
      <li>
        <Link to={`/about`}>ABOUT US</Link>
      </li>
      <li>
        <Link to={`/menu`}>MENU</Link>
      </li>
      <li>
        <Link to={`/faq`}>FAQ</Link>
      </li>
    </ul>
  );
}
export default Nav;
